class Solution(object):
    def canSortArray(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        # Function to count the number of set bits in an integer
        def countSetBits(n):
            count = 0
            while n:
                count += n & 1
                n >>= 1
            return count

        # Create a list of counts of set bits for each number
        bits_count = [countSetBits(num) for num in nums]

        # Create a dictionary to count occurrences of each set bit count
        bits_count_dict = {}
        for count in bits_count:
            if count in bits_count_dict:
                bits_count_dict[count] += 1
            else:
                bits_count_dict[count] = 1

        # Sort nums based on their set bits count
        nums_sorted_by_bits = sorted(nums, key=lambda x: (countSetBits(x), x))

        # Check if nums sorted by bits count is the same as nums sorted normally
        return nums_sorted_by_bits == sorted(nums)
